import React from 'react';
import { render } from 'react-dom';
import { createStore } from 'redux';

const initialState = {
    title: 'もちまっちげーみんぐ'
}

export default function testReducer(state = initialState, action) {
    switch (action.type) {
        default:
            return state;
    }
}
